import { CardActionArea } from '@mui/material';
import { CardContent } from '@mui/material';
import { Typography } from '@mui/material';
import { Card } from '@mui/material';
import axios from 'axios';
import React, { useEffect, useState } from 'react'
import Navbar2 from '../Navbar2';

function Profile() {
    const [bookings, setBookings] = useState([]);

  useEffect(() => {
    const fetchBookings = async () => {
      try {
        const customerId = localStorage.getItem('customerId');
       
        const response = await axios.get(`http://localhost:4000/booking/${customerId}`);
        const bookingData = response.data.bookings || [];

      
        const carDetailsData = await Promise.all(
          bookingData.map(async (booking) => {
            const carResponse = await axios.get(`http://localhost:4000/getsinglecar/${booking.carId}`);
            return {
              ...booking,
              carDetails: carResponse.data 
            };
          })
        );

        setBookings(carDetailsData);
