      } catch (error) {
        console.error('Error fetching bookings:', error);
      }
    };

    fetchBookings();
  }, []);
  return (
    <div>
        <Navbar2/>
  <div style={{ marginTop: "150px", marginLeft: "50px", color: "#c22424" }}>
        <h1>Booking History</h1>
      </div>
      <div style={{ marginLeft: "300px", marginTop: "50px" }}>
        {bookings.map((booking, index) => (
          <div key={index}>
            <Card sx={{ maxWidth: 345, marginTop: "20px" }}>
              <CardActionArea>
                <CardContent>
                  {/* <Typography gutterBottom variant="h5" color="error" component="div">
                    Employee ID: {booking.employeeId}
                  </Typography> */}
                  {booking.carDetails && (
                    <>
                    <Typography variant="h5" color="">
                       {booking.carDetails.model.toUpperCase()}
                    </Typography>
                    <br />
                     <Typography variant="body2" color="">
                     {booking.carDetails.brand.toUpperCase()}
                  </Typography>
                  </>
                  )}
                  <br />
                  {/* <Typography variant="body2" color="text.secondary">
                    Booking Date: {new Date(booking.bookingdate).toLocaleDateString()}
                  </Typography> */}
                </CardContent>
              </CardActionArea>
            </Card>
          </div>
        ))}
      </div>
    </div>
  )
}

export default Profile
